export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:e,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:e,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:e,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},oFyfvFwTW9:{data:{id:861,attributes:{imdbId:"tt2177461",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDQ1MDc2MjYtZjBhMi00ZjRlLWE5NDctMTVjNzNjMDc5ZGNmXkEyXkFqcGdeQXVyNTE1NjY5Mg@@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"8.0\u002F10"}],item_lang:{data:{id:1524,attributes:{title:f,plot:"In a world where witches, vampires and daemons live discreetly among humans, Diana Bishop is the last in one long line of distinguished witches. Unwilling to embrace her heritage she has immersed herself in her career as a historian. Her particular interest is alchemy and she visits Oxford to research some of Elias Ashmole's papers. She requests Ashmole 782 and as soon as she receives it she knows there is something uncanny about it; when she opens it she is shocked. She learns that 782 has been presumed lost for a very long time and that each species of Creature desires it. She is besieged and threatened and knows that, to protect herself, she must uncover all the mysteries of 782. She encounters the enigmatic vampire, Matthew Clairmont, who offers to help her; their mutual attraction is immediate, undeniable and inexplicable because they both know that witches and vampires are not supposed to trust each other. Diana makes her choice and accepts Matthew's help. This precipitates them into conflict with the Creature world.",slug:"a-discovery-of-witches"}}},books:{data:[{id:5279,attributes:{title:f,description:"Diana Bishop, a young scholar and the descendant of witches, discovers a long-lost and enchanted alchemical manuscript deep in Oxford's Bodleian Library. Its reappearance summons a fantastical underworld, which she navigates with her leading man, vampire geneticist Matthew Clairmont.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pMItwgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2011-10-01",publisher:"Riverhead Books",subtitle:a}},{id:5280,attributes:{title:f,description:"*Now a major Sky original production* THE NUMBER ONE INTERNATIONAL AND SUNDAY TIMES BESTSELLER. A Discovery of Witches is the first in the must-have, must-read ALL SOULS trilogy. It begins with absence and desire. It begins with blood and fear. It begins with a discovery of witches. Diana Bishop, a young scholar and descendant of witches, discovers a long-lost and enchanted alchemical manuscript deep in Oxford's Bodleian Library. Its reappearance summons a fantastical underworld, which she must navigate with a vampire, Matthew Clairmont. This manuscript, Ashmole 782, holds the secrets of their past . . . and the key to their future. 'Rich, thrilling . . . captivating' E L James 'Intelligent and off-the-wall' The Sunday Times 'I could lose myself in here and never want to come out' Manda Scott 'A bubbling cauldron of illicit desire' Daily Mail",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pRUCtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2018-09-20",publisher:a,subtitle:"Soon to Be a Major TV Series (All Souls 1)"}},{id:5281,attributes:{title:"A Discovery of Witches (Movie Tie-In)",description:"Book one of the New York Times-bestselling All Souls trilogy—\"a wonderfully imaginative grown-up fantasy with all the magic of Harry Potter and Twilight” (People). Look for the hit TV series “A Discovery of Witches,” streaming on AMC Plus, Sundance Now and Shudder. Season 2 premieres January 9, 2021! Deborah Harkness's sparkling debut, A Discovery of Witches, brought her into the spotlight and galvanized fans around the world. In this tale of passion and obsession, Diana Bishop, a young scholar and a descendant of witches, discovers a long-lost and enchanted alchemical manuscript, Ashmole 782, deep in Oxford's Bodleian Library. Its reappearance summons a fantastical underworld, which she navigates with her leading man, vampire geneticist Matthew Clairmont. Harkness has created a universe to rival those of Anne Rice, Diana Gabaldon, and Elizabeth Kostova, and she adds a scholar's depth to this riveting tale of magic and suspense. The story continues in book two, Shadow of Night, and concludes with The Book of Life. The story now comes alive in an incredibly lush eponymous TV series, starring Teresa Palmer (I Am Number Four, Hacksaw Ridge) and Matthew Goode (Match Point, The Imitation Game).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QJ9-DwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2019-01-08",publisher:"Penguin",subtitle:"A Novel"}},{id:5282,attributes:{title:"The Book of Life",description:"THE NO.1 SUNDAY TIMES AND NEW YORK TIMES HARDBACK BESTSELLER Fall under the spell of Diana and Matthew once more in the stunning climax to their epic tale, following A DISCOVERY OF WITCHES and SHADOW OF NIGHT. A world of witches, daemons and vampires. A manuscript which holds the secrets of their past and the key to their future. Diana and Matthew - the forbidden love at the heart of it. After travelling through time in SHADOW OF NIGHT, the second book in Deborah Harkness's enchant­ing series, historian and witch Diana Bishop and vampire scientist Matthew Clairmont return to the present to face new crises and old enemies. At Matthew's ancestral home in France they reunite with their families - with one heart-breaking exception. But the real threat to their future is yet to be revealed, and when it is, the search for the elusive manuscript Ashmole 782 and its missing pages takes on a terrifying urgency. Using ancient knowl­edge and modern science, from the palaces of Venice and beyond, Diana and Matthew will finally learn what the witches discovered so many centuries ago.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4zbNrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Deborah E. Harkness"],firstBook:c,published:"2015-04-09",publisher:a,subtitle:a}},{id:5283,attributes:{title:"The All Souls Trilogy Boxed Set",description:"A Discovery of Witches, Shadow of Night, and The Book of Life, now available in a beautiful boxed set With more than two million copies sold in the United States, the novels of the number one New York Times–bestselling All Souls Trilogy have landed on all the major bestseller lists, garnered rave reviews, and spellbound legions of loyal fans. Now all three novels are available in an elegantly designed boxed set that’s perfect for fans and newcomers alike.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CWHMrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2015-05-26",publisher:"Penguin Paperbacks",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377166920}}("","Deborah Harkness",null,"series","movie","A Discovery of Witches",1))